import "./App.css"
import React, { useState } from "react";
import Stack from "@mui/material/Stack";
import TextField from "@mui/material/TextField";
import Button from "@mui/material/Button";
import SendIcon from "@mui/icons-material/Send";
import axios from "axios";

function Footer({ name }) {
  return (
    <footer className="footer">
      Designed & Developed by {name} (2&#x2764;&#xfe0f;24) Sri Vasavi Engg.
      College
    </footer>
  );
}

function App() {
  const [responseData, setResponseData] = useState(null);

  const handleFormSubmit = () => {
    const url = document.querySelector("#standard-basic").value;
    axios
      .post("http://127.0.0.1:8000/", { URL: url })
      .then((response) => {
        setResponseData(response.data);
      })
      .catch((error) => {
        console.error(error);
      });
  };

  return (
    <div className="container-fluid">
      <h1 className="title">PhishDefender</h1>
      <div className="content">
        {responseData ? (
          <div>
            <p>Requested URL: {responseData.Requested_URL}</p>
            <p>Destination URL: {responseData.Destination_URL}</p>
          </div>
        ) : (
          <React.Fragment>
            <p>
              Think before you click!
              <br />
              We wish you're not going to be a victim...
            </p>
            <Stack direction="row" spacing={2}>
              <TextField
                id="standard-basic"
                label="URL"
                variant="standard"
                style={{ width: "100%" }}
                onKeyDown={(e) => {
                  if (e.key === "Enter") {
                    handleFormSubmit();
                  }
                }}
              />
              <Button
                variant="contained"
                endIcon={<SendIcon />}
                style={{ maxHeight: "50%", padding: "0px 20px" }}
                color="primary"
                onClick={handleFormSubmit}
              >
                Submit
              </Button>
            </Stack>
            <Footer></Footer>
          </React.Fragment>
        )}
      </div>
    </div>
  );
}

export default App;
